**🔴مهلت ثبت‌نام خودروهای وارداتی تا ۲۰ آذر تمدید شد**

🔹مدیر طرح واردات خودروی وزارت صمت: مهلت وکالتی‌کردن حساب برای خرید خودروهای وارداتی تا ۱۹ آذر و مهلت ثبت‌نام یا انتخاب خودرو تا ۲۰ آذر تمدید شده است.

