**🔴تولید، کیفیت و کاهش بهای تمام شده تولید، محورهای سه‌گانه نجات صنعت خودرو**

🔻مدیرعامل ایران‌خودرو افزایش تیراژ تولید، ارتقای کیفیت و کاهش بهای تمام شده تولید را سه محور و ماموریت اصلی برای نجات صنعت خودرو خواند و گفت: در شرایطی که با حمایت‌های دولت و وزارت صمت، زمینه بهبود و افزایش تیراژ تولید فراهم شده، باید با برنامه‌ریزی دقیق اهداف ترسیم شده را محقق کنیم.


